import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Note from './Note';
import character from './character';
import CreateArea from './CreateArea';
function App(){
    
    return <div>
    <Header />
    <CreateArea />
    <div class="notes-container">
    {character.map((inf) => (
          <Note
            key={inf.id }
            title={inf.charac}
            des={inf.mydesp}
          />
        ))}
</div>
    <Footer />
    </div>;
}
export default App;
